import styled from "styled-components";
import Text from "./ui-components/text";
import {Table} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import {useState} from "react";

const Wrapper = styled.div`
  min-height: 100vh;
  padding: 0 15px;
  display: flex;
  flex-direction: column;
`;

function App() {
    const [state, setState] = useState([{
        id: 14,
        email: "antonida@mail.com",
        first_name: "Antonida",
        pay_status: false,
        last_name: "White",
        username: "AntonidaW",
        profile_link: "https://fizikl.ru/"
    }, {
        id: 17,
        email: "butonchick@gmail.com",
        first_name: "",
        pay_status: true,
        last_name: "Zorro",
        username: "ananimus007",
        profile_link: "https://translate.google.com/?sl=de&tl=ru&text=Herzlich%20willkommen!&op=translate"
    }, {
        id: 8,
        email: "vasya2007@mail.ru",
        first_name: "Вася",
        pay_status: false,
        last_name: "Пупкин",
        username: "superVasssya",
        profile_link: ""
    }, {
        id: 12,
        email: "antonio@mail.com",
        first_name: "Anton",
        pay_status: true,
        last_name: "Black",
        username: "ABlack",
        profile_link: "https://translate.google.com/"
    }])

    return (
        <Wrapper>
            <div style={{margin: "200px auto"}}>
                <Text color={"black"} fontSize={"44px"} fontWeight={600}>
                    Users
                </Text>
                <div style={{marginTop: "20px"}}>
                    <Table striped bordered hover>
                        <thead>
                        <tr>
                            <th>Id</th>
                            <th>First Name</th>
                            <th>Last Name</th>
                            <th>Username</th>
                            <th>Email</th>
                            <th>Pay status</th>
                            <th>Link</th>
                        </tr>
                        </thead>
                        <tbody>
                        {state.map((item, index) => (
                            <tr>
                                <td>{item.id}</td>
                                <td>{item.first_name}</td>
                                <td>{item.last_name}</td>
                                <td>{item.username}</td>
                                <td>{item.email}</td>
                                <td>{item.pay_status ? "Оплатил" : "Не оплатил"}</td>
                                <td>{item.profile_link}</td>
                            </tr>
                        ))}
                        </tbody>
                    </Table>
                </div>
            </div>
        </Wrapper>
    );
}

export default App;
